webpackJsonp([0xcf4ece0f83cd],{686:function(e,o){e.exports={data:{markdownRemark:{html:'<h1>Using static resources</h1>\n<p>Elements uses a set of static resources like images or icons. In order to benefit from caching across all apps, these resources are provided by a static asset CDN.</p>\n<h2>When to use the ResouceProvider</h2>\n<p>Whenever you like to use Icons or Illustrations, you need to use the\nResouceProvider to let the components know where they are.</p>\n<pre><code class="language-example">&#x3C;ThemeProvider>\n    &#x3C;ResourceProvider>\n        &#x3C;Icon name="trending-up" color="red" />\n    &#x3C;/ResourceProvider>\n&#x3C;/ThemeProvider>\n</code></pre>',internal:{content:'---\nname: Static Resouces\ncategory: Getting started\ntitle: \'jo\'\nkeywords:\n  - Button\n  - Actions\n---\n\n# Using static resources\nElements uses a set of static resources like images or icons. In order to benefit from caching across all apps, these resources are provided by a static asset CDN.\n\n## When to use the ResouceProvider\nWhenever you like to use Icons or Illustrations, you need to use the\nResouceProvider to let the components know where they are.\n\n```example\n<ThemeProvider>\n    <ResourceProvider>\n        <Icon name="trending-up" color="red" />\n    </ResourceProvider>\n</ThemeProvider>\n```\n'},frontmatter:{title:"jo"}}},pathContext:{slug:"/using-static-resources.html"}}}});